// School.js

import React, {Component} from 'react'




class School extends Component{

    constructor(props) {
        super(props)

        this.state = {
            text: props.value,
            isEditing: false,
            tag: props.tag,
            default: props.value
        }
    }


    render() {
    return (
		<div className="school">
            I'm a school
        </div>
        )
    }
}

export default School;
